import React, { useState, useEffect } from "react";
import axios from "axios";

function App() {
  const [data, setData] = useState({ data: [] });
  const [url, setUrl] = useState("2019-11-28");

  useEffect(() => {
    const fetchData = async () => {
      const response = await axios(
        `https://api.coindesk.com/v1/bpi/historical/close.json?start=${url}-01&end=2019-12-13`
      );
      setData(response);
    };
    fetchData();
  }, [url]);
  console.log("object", data);
  return (
    <div>
      <h1>the new app works</h1>
      hello App
      <form>
        <button
          type="button"
          onClick={() =>
            setUrl(`http://hn.algolia.com/api/v1/search?query=${url}`)
          }
        >
          Search
        </button>
        <ul>
          {data.data.map(item => (
            <li key={item.objectID}>
              <a href={item.url}>{item.title}</a>
            </li>
          ))}
        </ul>
      </form>
    </div>
  );
}

export default App;
